import React from 'react';
import {
    AnimatedAxis,
    AnimatedGrid,
    AnimatedLineSeries,
    XYChart,
    Tooltip
  } from "@visx/xychart";
  const data1 = [
    {
      x: "2018-03-01",
      y: 30
    },
    {
      x: "2018-04-01",
      y: 16
    },
    {
      x: "2018-05-01",
      y: 17
    },
    {
      x: "2018-06-01",
      y: 24
    },
    {
      x: "2018-07-01",
      y: 47
    },
    {
      x: "2018-08-01",
      y: 32
    },
    {
      x: "2018-09-01",
      y: 8
    },
    {
      x: "2018-10-01",
      y: 27
    },
    {
      x: "2018-11-01",
      y: 31
    },
    {
      x: "2018-12-01",
      y: 105
    },
    {
      x: "2019-01-01",
      y: 166
    },
    {
      x: "2019-02-01",
      y: 181
    },
    {
      x: "2019-03-01",
      y: 232
    },
    {
      x: "2019-04-01",
      y: 224
    },
    {
      x: "2019-05-01",
      y: 196
    },
    {
      x: "2019-06-01",
      y: 211
    }
  ];  

  const accessors = {
    xAccessor: (d) => new Date(`${d.x}T00:00:00`),
    yAccessor: (d) => d.y
  };
  const LineChart = () => {
    return (
      <XYChart height={300} xScale={{ type: "time" }} yScale={{ type: "linear" }}>
        <AnimatedAxis orientation="bottom" numTicks={4} />
        <AnimatedAxis orientation="left" numTicks={4} />
        <AnimatedGrid columns={false} numTicks={2} />
        <AnimatedLineSeries dataKey="Line 1" data={data1} {...accessors} />
        <Tooltip
          snapTooltipToDatumX
          snapTooltipToDatumY
          showVerticalCrosshair
          showSeriesGlyphs
          renderTooltip={({ tooltipData, colorScale }) => <div></div>}
        />
      </XYChart>
    );
  };

const BarChart = () => {
    return (
        <XYChart height={300} xScale={{ type: "time" }} yScale={{ type: "linear" }}>
        <AnimatedAxis orientation="bottom" numTicks={4} />
        <AnimatedAxis orientation="left" numTicks={4} />
        <AnimatedGrid columns={false} numTicks={2} />
        <AnimatedLineSeries dataKey="Line 1" data={data1} {...accessors} />
        <Tooltip
          snapTooltipToDatumX
          snapTooltipToDatumY
          showVerticalCrosshair
          showSeriesGlyphs
          renderTooltip={({ tooltipData, colorScale }) => <div></div>}
        />
      </XYChart>
    );
};

export default BarChart;
